import React, {Component} from 'react';
import NewsletterInfo from "../../Components/NewsletterInfo/Newsletter_Info";
import BottomInfo from "../../Components/BottomInfo/BottomInfo";
import TopMenu from "../../Components/TopMenu/TopMenu";
import ProductList from "../../Components/Shop/ProductList";
import TopImg from "../../Components/Shop/topImg.png";
import TopTooltip from "../../Components/Shop/TopTooltip";
import { BrowserRouter, Route } from 'react-router-dom';
class Shop extends Component {

  constructor(props) {

    super(props)

    this.props = props;

    this.state = {
      id: null,
    }
  

  
  }

  render() {

    
    return (

      

        <div className="shop">


          <TopTooltip/>;

          
          <div>{this.props.locationId}</div>
          
          <img className="shop__topImg" src={TopImg} alt="graphics"/>
          <NewsletterInfo />
          <BottomInfo />
          <TopMenu />

          <BrowserRouter>
         
          <Route path="/shop/all" render={() => {<ProductList returnLocation="all" />}} />
          <Route path="/shop/ring" render={() => {<ProductList returnLocation="ring" />}} />
          <Route path="/shop/bracelets" render={() => {<ProductList returnLocation="bracelets" />}} />
          <Route path="/shop/necklaces" render={() => {<ProductList returnLocation="necklaces" />}} />
          <Route path="/shop/earrings" render={() => {<ProductList returnLocation="earrings" />}} />

          </BrowserRouter>
          

        </div>


    );
  }
}

export default Shop;
